import React from 'react';

const ListInput = ({inputField}) => {
    return (
        <div className='list-input'>
            <input onChange={inputField}type='text' placeholder='add item' />
            <button onClick={inputField}>Submit</button>
        </div>
    )
}

export default ListInput;
